import React from 'react';
import { v4 as uuidv4 } from 'uuid';
import Blog from '../Blog';
import './Main.css';

function Main({ blogs }) {
  return (
    <main>
      {blogs.map((blog) => (
        <Blog
          key={uuidv4()}
          imgName={blog.imgName}
          date={blog.date}
          time={blog.time}
          title={blog.title}
          description={blog.description}
          initialClapCount={blog.initialClapCount}
        />
      ))}
    </main>
  );
}

